import React from "react";
import { Line } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";
import axios from 'axios';

class ChartsPage extends React.Component {
  state = {
    dataLine: {
      labels: ["January", "February", "March", "April", "May", "June", "July"],
      datasets: [
        {
          label: "Requests fulfilled",
          fill: true,
          lineTension: 0.3,
          backgroundColor: "rgba(225, 204,230, .3)",
          borderColor: "rgb(205, 130, 158)",
          borderCapStyle: "butt",
          borderDash: [],
          borderDashOffset: 0.0,
          borderJoinStyle: "miter",
          pointBorderColor: "rgb(205, 130,1 58)",
          pointBackgroundColor: "rgb(255, 255, 255)",
          pointBorderWidth: 10,
          pointHoverRadius: 5,
          pointHoverBackgroundColor: "rgb(0, 0, 0)",
          pointHoverBorderColor: "rgba(220, 220, 220,1)",
          pointHoverBorderWidth: 2,
          pointRadius: 1,
          pointHitRadius: 10,
          data: [65, 59, 80, 81, 56, 55, 40]
        }
      ]
    }
  };

  componentDidMount() {
    axios.get('http://localhost:4000/ceo/requestsperagentchart')
        .then(response => {
            this.setState({ data1 : response.data.map(function(current_count,i){
              return (Object.values(current_count))
            })});
            this.state.dataLine.datasets[0].data = this.state.data1.map(function(currentAgent,i){
                return (currentAgent[1])
            });
            this.state.dataLine.labels=this.state.data1.map(function(currentAgent,i){
                return (currentAgent[0])
            })
            console.log(this.state.data1);
          }
        )
        .catch(function (error){
            console.log(error);
        }   )
}

  render() {
    return (
      <MDBContainer>
        <h3 className="mt-5">Requests fulfilled by Agents</h3>
        <Line data={this.state.dataLine} options={{ responsive: true }} />
      </MDBContainer>
    );
  }
}

export default ChartsPage;
